-- LocalScript GUI
local Players = game:GetService("Players")
local player = Players.LocalPlayer

-- Tạo GUI
local screenGui = Instance.new("ScreenGui")
screenGui.Parent = player:WaitForChild("PlayerGui")

-- Nút bật/tắt
local toggleButton = Instance.new("TextButton")
toggleButton.Size = UDim2.new(0, 120, 0, 40)
toggleButton.Position = UDim2.new(0, 20, 0, 200)
toggleButton.Text = "Chat AI"
toggleButton.BackgroundColor3 = Color3.fromRGB(0, 170, 255)
toggleButton.TextColor3 = Color3.new(1,1,1)
toggleButton.Parent = screenGui

-- Menu Chat
local frame = Instance.new("Frame")
frame.Size = UDim2.new(0, 400, 0, 300)
frame.Position = UDim2.new(0.5, -200, 0.5, -150)
frame.BackgroundColor3 = Color3.fromRGB(40, 40, 40)
frame.Visible = false
frame.Parent = screenGui

local chatBox = Instance.new("TextBox")
chatBox.Size = UDim2.new(1, -20, 0, 40)
chatBox.Position = UDim2.new(0, 10, 1, -50)
chatBox.PlaceholderText = "Nhập câu hỏi..."
chatBox.Parent = frame

local responseLabel = Instance.new("TextLabel")
responseLabel.Size = UDim2.new(1, -20, 1, -70)
responseLabel.Position = UDim2.new(0, 10, 0, 10)
responseLabel.TextWrapped = true
responseLabel.TextColor3 = Color3.new(1,1,1)
responseLabel.BackgroundTransparency = 1
responseLabel.Text = "Hỏi mình bất cứ điều gì!"
responseLabel.Parent = frame

-- Toggle hiển thị menu
toggleButton.MouseButton1Click:Connect(function()
    frame.Visible = not frame.Visible
end)

-- Xử lý nhập câu hỏi
chatBox.FocusLost:Connect(function(enterPressed)
    if enterPressed then
        local question = string.lower(chatBox.Text)
        if responses[question] then
            responseLabel.Text = responses[question]
        else
            responseLabel.Text = "Xin lỗi, mình chưa có câu trả lời cho câu hỏi này."
        end
        chatBox.Text = ""
    end
end)
